import navBar from "../../data/navBar.json";


const Home = (props) => {

	return (
    <div>
      <div className='header'>
        <Header></Header>
		  </div>
      <Icon></Icon>
    </div>

	);
};

export default Home;

import React from "react";
import "./dist/home.css";
import icons from "../../data/navBar.json";

const Header = () => {
  return (
    <div className="header">
      <div className="left">
        <h1>booking website</h1>
      </div>
      <div className="right">
        <button className="btn btn-light">register</button>
        <button className="btn btn-light">login</button>
      </div>

    </div>
  );
};
// export default Header;

const Icon = () => {
  return (
    <div className="icon">
      <NavbarItem items={navBar}></NavbarItem>
    </div>
  );
};
// export default Icon;
